      recipient: {
        id: senderID
      },
      message: {
        text: "Accepter le partage de position:",
        quick_replies:[
          {
            content_type: "location"
          }
        ]  
      }
    }

    this.callSendAPI(messageData);
  },
  ///////////////////////////////////////////////////////////////////////////////////////
  //sendResponse = formatting jsonData and sender info before giving info to callSendAPI
  ///////////////////////////////////////////////////////////////////////////////////////

