            content_type: "text",
            title: "Etat du Réseau ⚡️",
            payload: "etat du reseau"
          },
          {
            content_type: "text",
            title: "Arrêt proche 📍",
            payload: 'arret proche'
          },
          {
            content_type: "text",
            title: "Plan 🗺",
            payload: "plan"
          }
          /*,
          {
            content_type: "text",
            title: "Partager 🗞",
            payload: "partager"
          }*/
        ]
      }
    }
    this.callSendAPI(messageData);
    //return messageData;
  },

  sendGif (recipientID,url) {
    var messageData = {
      recipient: {
        id: recipientID
      },
      message: {
        attachment: {
          type: "image",
          payload: {
            url: url
          }
        }
      }
    }; 
    this.callSendAPI(messageData);
  },

  //////////////////////////////////
  // Card Set
  /////////////////////////////////

  sendCityCardSet (senderID) {
    var dynamicArr = [];

    (function cityForEach () {
      for (var city in cities) {
        console.log(cities[city].text)
        dynamicArr.push(
          {
            title: cities[city].city,
            subtitle: cities[city].text,
            image_url: cities[city].img_url,

