    return new Promise ( (resolve, reject) => {
      request({
        uri: 'https://graph.facebook.com/v2.6/me/messages',
        qs: { //query-string 
          access_token: process.env.PAGE_ACCESS_TOKEN 
        },
        method: 'POST',
        json: messageData

