    return new Promise ( (resolve, reject) => {
      var messageData = {
        recipient: {
          id: recipientID
        },
        message: {
          text: messageText
        }
      };
      resolve(messageData);
      //reject(console.log('error occurred in sendTextMessagePromise resolving'));
    });
  }
